var main = document.getElementById("main");
var imageStream = document.getElementById("imageStream");
var filteredImages = images;
var f = document.getElementById("focuser");
imageStream.innerHTML = generateImageStream(filteredImages);
f.onclick = defocus;
f.occupied = false;
document.getElementById("olay").onclick = defocus;
document.getElementById("right").onclick = function() {cycle(1);};
document.getElementById("left").onclick = function() {cycle(-1);};
document.getElementById("right").onmouseover = function() {setOp(1,0.4);};
document.getElementById("left").onmouseover = function() {setOp(-1,0.4);};
document.getElementById("right").onmouseout = function() {setOp(1,0.05);};
document.getElementById("left").onmouseout = function() {setOp(-1,0.05);};
document.getElementById("butt").onclick = function() {searchImages()};
document.getElementById("query").addEventListener("keyup", function(event) {
    event.preventDefault();
    if (event.keyCode == 13) {
        searchImages();
    }
});
document.addEventListener("keyup", function(event) {
    event.preventDefault();
    if (event.keyCode == 39) {
        cycle(1);
    } else if (event.keyCode == 37) {
        cycle(-1);
    } 
});

function generateImageStream(imageArray) {
	imageStr = "";
	for (var i = 0; i < imageArray.length; i++) {
		imageStr += "<img id = " + i + " src = " + imageArray[i].unmarked + " class = justify_image onload = \"show(" + i + ")\" onclick = \"focusOn(" + i + ")\"> </img> ";
	}
	return imageStr;
}
function createConditional(str) {
	return function(img) {
		if(img.name.includes(str)) {
			return true;
		} else if (img.tags.some(function(t) {return t.includes(str);})) {
			return true;
		} else {
			return false;
		}
	};
}
function searchImages() {
	var q = document.getElementById("query").value;
	if(q == "") {
		filteredImages = images;
	} else {
		filteredImages = images.filter(createConditional(q));
	}
	imageStream.innerHTML = generateImageStream(filteredImages);
}
function show(id) {
	// console.log("showing " + id);
	document.getElementById(id).display = "inline-block";
	setTimeout(function() {$("#"+id).fadeIn("slow")}, 1000 + 50* id);
}
function focusOn(id) {
	var i = document.getElementById(id);
	var is = i.style;
	var fs = f.style;
	if (!f.occupied) {
		var rect = i.getBoundingClientRect();
		$("#focuser").css("top",rect.top);
		$("#focuser").css("left",rect.left);
		is.opacity = 0;
		f.src = i.src;
		fs.height = "250px";
		fs.display = "block";
		var cH = document.documentElement.clientHeight;
		var cW = document.documentElement.clientWidth;
		var centerTop = cH / 2 - (cH * 0.9 / 2);
		var centerLeft = cW / 2 - (cH * 0.9 * (f.width / f.height) / 2);
		$("#focuser").animate({top: centerTop}, { queue: false, duration: 500 })
		.animate({left: centerLeft}, { queue: false, duration: 500 })
		.animate({height: "90%"}, { queue: false, duration: 500 });
		f.occupied = true;
		f.occupant = id;
		main.setAttribute("class","blur");
		document.getElementById("olay").style.display = "block";
		document.getElementById("right").style.display = "block";
		document.getElementById("left").style.display = "block";
		document.getElementById("tool_bar").style.display = "block";
	}
}
function defocus() {
	if (f.occupied) {
		main.setAttribute("class",null);
		document.getElementById("olay").style.display = "none";
		document.getElementById("right").style.display = "none";
		document.getElementById("left").style.display = "none";
		document.getElementById("tool_bar").style.display = "none";
		f.occupied = false;
		document.getElementById(f.occupant).style.opacity = 1;
		f.style.display = "none";
	}
}
function cycle(inc) {
	var oc = f.occupant;
	if (f.occupied && oc + inc >= 0 && oc + inc < filteredImages.length) {
		f.src = document.getElementById(oc + inc).src;
		f.occupant = oc + inc;
		$("#focuser").css("left", document.documentElement.clientWidth / 2 - f.width / 2);
		document.getElementById(oc).style.opacity = 1;
	}
}

function setOp(direct, op) {
	if(direct == -1) {
		$("#left").animate({opacity: op}, {queue: false, duration: 100});
	} else {
		$("#right").animate({opacity: op}, {queue: false, duration: 100});
	}
}